    def check_Line(self):
        """
        function for checking whether product name and product code are empty or not.
        @return: producr_Name, product_Code
        @rtype: string or integer
        """
        self.product_Name = self.lineEdit_8.text()
        self. product_Code = self.lineEdit_9.text()
        if (self.product_Name != '' and  self.product_Code != ''):
            return(self.product_Name, self.product_Code)
        else:
            return(-1, -1)
